import React, { Component } from 'react';
import styled from 'styled-components'

const Head = styled.h1`
  margin-bottom: 3%;
  margin-top: 10%;
  font-size: 55px;
  font-weight: bold;
  line-height: 1.35;
  color: #69302c;
`

const Sub = styled.p`
  font-size: 24px;
  font-weight: 500;
  color: #69302c;
`
class App extends Component {
    render() {
        return (
            <div class="container">
                <div class="row">
                    <div class="col">
          <Head>
            ถ้าพูดเยอะอาจจะเจ็บคอ<br />
            แต่ถ้ามา Talk n' Chip 2019<br />
            แล้วพูดไม่พอจะเสียใจ
          </Head>
          <Sub>23 กุมพาพันธ์ 2019 ณ มหาวิทยาลัยเทคโนโลยีพระจอมเกล้าธนบุรี อาคารเรียนรวม 2 ชั้น 4 ห้อง 2401 และ 2402</Sub>
        </div>
      </div>
      <div class="row">
        <div class="col m-0" xs='12' md='5' lg='3'>
            <Button block>ส่งหัวข้อที่จะไปพูดกันเลย !</Button>
        </div>
        </div>
      </div>
                    );
                  }
                }
export default App
